import React from 'react';
import { NavContent } from './NavbarStyle';

const Nav = ({
    title,
}) => (
  <div className="d-flex align-items-center" fluid>
  <NavContent>
    <NavContent.Brand href="#home">{title}</NavContent.Brand>
  </NavContent>

  </div>
);

export default Nav;
